import React, { useEffect } from "react";
import { parse } from "qs";

const App = () => {
  useEffect(() => {
    let data = [
      { pseudo: "Denis", age: 33, techno: ["Javascript", "php", "Ruby"] },
      { pseudo: "Moussa", age: 23, techno: ["python", "nodejS", "MongoDb"] },
      { pseudo: "Isaac", age: 2, techno: ["java", "c++", "c"] }
    ];
    document.body.innerHTML += data
      .map(ok => ` <div className="user-card" >${ok.techno}</div>`)
      .join(" ");
  });

  return <></>;
};

export default App;
